import React from 'react';
import './ProcessUnitPage.css';

const SeparatorPage = () => (
  <div className="process-unit-page">
    <h1>Separator</h1>
    <img src="https://images.unsplash.com/photo-1519125323398-675f0ddb6308?auto=format&fit=crop&w=800&q=80" alt="Separator" className="unit-image" />
    <p>
      Separators are used to divide mixtures into their component parts. They are essential in both chemical and physical processing.
    </p>
  </div>
);

export default SeparatorPage;
